import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import {Card, Grid} from '@material-ui/core'
import { Header, colors } from 'tabler-react';
import Box from '@material-ui/core/Box';
import {Card as TCard} from 'tabler-react';

const data = require('../../../data/experience.json')

const useStyles = makeStyles((theme) => ({
  header: {
    color: '#EE231A',
    fontWeight: 'bold',
    fontSize: '32px'
  }
}));

export default function ExperienceGrid(props) {
  const classes = useStyles();
  return (
    <Grid container spacing={3}>
      {data.map(stat => (
          <Grid xs={6} padding={3}>
            <Box padding={1.5} paddingBottom={0.5}>
            <Card elevation={0} >
              <TCard.Body className="text-center" paddingTop={-2}>
                <Header
                  className={classes.header}
                  color={'#EE231A'}
                >
                  {stat['Header']}
                </Header>
                <Box height={200}>

                </Box>
              </TCard.Body>
            </Card>
            </Box>

          </Grid>
      ))}
    </Grid>
  );
}
